	add("doublespeak", "{\"term\":\"doublespeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|double|speak|lang\u003den}}. Coined in the 1950s in the vein of w:George Orwell|George Orwell\u0027s Newspeak as used in his book w:Nineteen Eighty-Four|Nineteen Eighty-Four. The word \u0027doublespeak\u0027 does not appear in the book, although \u0027newspeak\u0027, \u0027oldspeak\u0027, and \u0027doublethink\u0027 do.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any language deliberately constructed to disguise or distort its actual meaning, often by employing euphemism or ambiguity. Typically used by governments or large institutions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The report was riddled with so much corporate \u0027\u0027doublespeak\u0027\u0027 that it was impossible to interpret\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, Brent D. Ruben, \u0027The Coming of the Information Age\u0027, in \u0027Information and Behavior\u0027 (Brent D. Ruben, ed.), page\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The popular and convergent use of \u0027information\u0027 seems to represent something beyond the mere cosmetics of \u0027\u0027doublespeak\u0027\u0027, of a \u0026quot;garbage collector\u0026quot; turned \u0026quot;sanitary engineer\u0026quot; or a \u0026quot;strike\u0026quot; turned \u0026quot;work stoppage.\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

